import React from 'react'

export const UserOutput = (props) => {
    return (
        <div className="StyleSheet"  style={props.style} >
            <p> My name is {props.userName}</p>
            <p onClick={()=>props.click(index)}> I am {props.age}</p>
        </div>
    )
}

export default UserOutput;
